import React, {useEffect, useState} from 'react'
import getStarred from '../../service/get-starred'


function ModalStarred(user) {

const [starred, setStarred] = useState([])

useEffect(() => {
  getStarred(user.userName).then((response) => {
    setStarred(response)
  })

  return(
    <>

   <button type="button" className="btn btn-primary btn-sm" data-bs-toggle="modal" data-bs-target="#staticBackdrop">
     Starred
   </button>


   <div className="modal fade" id="staticBackdrop" data-bs-backdrop="static" data-bs-keyboard="false" tabindex="-1" aria-labelledby="staticBackdropLabel" aria-hidden="true">
     <div className="modal-dialog">
       <div className="modal-content">
         <div className="modal-header">
           <h5 className="modal-title" id="staticBackdropLabel">Starreds</h5>
           <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
         </div>
         <div className="modal-body">
           {starred && starred.map((item, index) => {
             <div key={index}>
             <span>{item.name}</span>
             <span>{item.full_name}</span>
             </div>

           })}
         </div>
         <div className="modal-footer">
           <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">Fechar</button>
         </div>
       </div>
     </div>
   </div>
   </>
       )

}, [])

// console.log('starred', starred.full_name)
}
export default ModalStarred
